import React, { Component } from "react";

class Main extends Component {
  render() {

    const { id, name, age, skill } = this.props;

    return (
      <div>
        <h1 key={id}>
          'Hello! My name is {name}. I am {age}. I am studying {skill}""
        </h1>
      </div>
    );
  }
}

export default Main;
